import C from "../../../constants";

export const ClearDetailedReport = () => {
    return {     
        type: C.CLEAR_DETAILED_REPORT,
        payload: {

        }
    }
}

export const setPageNumber = (pageNO) => {
    return {     
        type: C.SET_PAGENUMBER,
        payload: {
            pageNO: pageNO
        }
    }
}
export default ClearDetailedReport();
